import React, { PureComponent } from 'react'
import './Ilustracao.scss';

class Ilustracao extends PureComponent {

    render() {
        return (
            <div id="Ilustracao">
                <div>
                <h3>ilutracao</h3>

                <div className="ilustrator">
                    <img src="https://i.imgur.com/UR7GQMLh.jpg" title="source: imgur.com" />
                </div>
            </div>
            </div>

        )
    }
}

export default Ilustracao
